import React, { useState } from 'react';
import { sendEmail } from '../utils/emailService';

const Contact = () => {
  const [formStatus, setFormStatus] = useState(null);

  // Change the handleSubmit function to:
const handleSubmit = async (e) => {
  e.preventDefault();
  setFormStatus('sending');
  
  try {
    await sendEmail({
      name: e.target.name.value,
      email: e.target.email.value,
      subject: e.target.subject.value,
      message: e.target.message.value
    });
    setFormStatus('success');
    e.target.reset();
  } catch (error) {
    console.error('Email send error:', error);
    setFormStatus('error');
  }
};

  return (
    <section className="contact" id="contact">
      <div className="container">
        <h2 className="section-title">Contact Me</h2>
        <div className="contact-container">
          <div className="contact-info">
            <div className="contact-item">
              <i className="fas fa-phone"></i>
              <div className="contact-text">
                <h3>Phone</h3>
                <a href="tel:+916371791893" target="_blank" rel="noopener noreferrer">
                  +916371791893
                </a>
              </div>
            </div>
            
            <div className="contact-item">
              <i className="fas fa-envelope"></i>
              <div className="contact-text">
                <h3>Email</h3>
                <a href="mailto:souravdilu78090@gmail.com" target="_blank" rel="noopener noreferrer">
                  souravdilu78090@gmail.com
                </a>
              </div>
            </div>
            
            <div className="contact-item">
              <i className="fab fa-github"></i>
              <div className="contact-text">
                <h3>GitHub</h3>
                <a href="https://github.com/sDash151" target="_blank" rel="noopener noreferrer">
                  github.com/sDash151
                </a>
              </div>
            </div>
            
            <div className="contact-item">
              <i className="fab fa-linkedin"></i>
              <div className="contact-text">
                <h3>LinkedIn</h3>
                <a 
                  href="https://www.linkedin.com/in/sourav-dash-a12436336" 
                  target="_blank" 
                  rel="noopener noreferrer"
                >
                  linkedin.com/in/sourav-dash
                </a>
              </div>
            </div>
          </div>
          
          <div className="contact-form">
            <form id="contactForm" onSubmit={handleSubmit}>
              <div className="form-group">
                <label htmlFor="name">Name</label>
                <input type="text" id="name" name="name" required />
              </div>
              
              <div className="form-group">
                <label htmlFor="email">Email</label>
                <input type="email" id="email" name="email" required />
              </div>
              
              <div className="form-group">
                <label htmlFor="subject">Subject</label>
                <input type="text" id="subject" name="subject" required />
              </div>
              
              <div className="form-group">
                <label htmlFor="message">Message</label>
                <textarea id="message" name="message" required></textarea>
              </div>
              
              <button type="submit" className="btn" disabled={formStatus === 'sending'}>
                {formStatus === 'sending' ? 'Sending...' : 'Send Message'}
              </button>
              
              {formStatus === 'success' && (
                <p className="form-success">Message sent successfully!</p>
              )}
              {formStatus === 'error' && (
                <p className="form-error">Error sending message. Please try again.</p>
              )}
            </form>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Contact;
